/**
   * Everything you need to know is below:
   * Source:  https://github.com/vednoc/onyx
   * Discord: https://discord.gg/NpT8PzA
   * License: MIT
   */

  :root {
    --dark:    #272C35;
    --darker:  #1F232A;
    --light:   #D1D1D1;
    --lighter: #E9E9E9;
    --accent:  #7289DA;
    --icon:    #E1E1E1;
    --shadow:  rgba(0,0,0,0.10);
    --mred:    #A3525B;
    --mgreen:  #70A352;
    --mblue:   #527AA3;
    --hover-delay: 0.8s;
    --emojiOpacity: 0.75;
    --ui-font: 'font_name', 'Segoe UI', 'Helvetica Neue', 'Helvetica', 'Lucida Grande', 'Arial', 'Ubuntu', 'Cantarell', 'Fira Sans', sans-serif;
    --version: "WhatsApp by Mew v1.6.2";
    --message: "Updated on 18th of November. Addressing GH issues and pull requests. ";
    --changes: "See the changelog at: https://github.com/vednoc/onyx/releases";
  }

  /* Body reset. */
  body {
    font-family: var(--ui-font);
    background: none;
    background-color: var(--dark); }

  /* Scrollbar track. */
  *::-webkit-scrollbar-track {
    background-color: var(--shadow); }
  /* Scrollbar thumb. */
  *::-webkit-scrollbar-thumb {
    background-color: var(--accent); }
  * {
    scrollbar-width: thin;
    scrollbar-color: var(--accent) var(--shadow); }

  /* Highlight selection. */
  ::selection {
    color: var(--light) !important;
    background-color: var(--accent) !important; }
  ::-moz-selection {
    color: var(--light) !important;
    background-color: var(--accent) !important; }
  /* Input placeholders. */
  ::placeholder { color: var(--lighter) !important; }
  ::-moz-placeholder { color: var(--lighter) !important; }
  ::-webkit-input-placeholder { color: var(--lighter) !important; }

  /* Progress. */
  progress[value]::-webkit-progress-bar {
    background: var(--darker); }
  /* Value. */
  progress[value]::-webkit-progress-value {
    background: var(--accent); }
  progress {
    background: var(--darker); }
  ::-moz-progress-bar {
    background: var(--accent) !important; }

  /* App wrapper. */
  #app .app {
    background: none;
    background-color: var(--dark); }

  /* Log-in page. */
  .landing-wrapper::before {
    opacity: 0.6;
    background-color: var(--accent) !important; }
  .landing-window {
    border-radius: 4px !important;
    border: 1px solid var(--shadow);
    box-shadow: 0 8px 32px 0 var(--shadow) !important;
    background-color: var(--darker) !important; }
  .landing-main + div {
    background-color: var(--darker) !important; }
    .landing-main + div img:not(:hover) {
      opacity: 0.3; }
    /* Text color. */
    .landing-main * {
      color: var(--light); }
    /* Reload QR code. */
    ._1MOym {
      background-color: var(--darker) !important; }
    ._3PxOr rect {
      fill: var(--dark) !important; }
    /* Fix QR code. */
    .landing-wrapper div[data-ref] {
      border-radius: 0;
      filter: contrast(150%) !important;
      outline: 4px solid white !important; }
    /* Loader. */
    #startup svg > circle {
      stroke: var(--lighter) !important; }
  /* Logo colors. */
  span._3PxOr svg path:nth-child(1) {
    fill: var(--dark) !important; }


  /* Landing page. */
  .app .iFKgT {
    border: none;
    background-color: var(--dark) !important; }
    /* Image. */
    .app .iFKgT [data-asset-intro-image] {
      max-width: 200px;
      max-height: 200px;
      border-radius: 50%;
      filter: opacity(0.75);
      transition: opacity 1s ease !important; }
    /* Text color. */
    .app .iFKgT * {
      color: var(--light); }
    /* Accent bar. */
    .app .iFKgT::after {
      border-top-color: var(--accent) !important; }
    /* Hide the text. */
    .iFKgT ._3mkas { font-size: 0px; }
    /** Theme note. */
    .app .iFKgT ._3mkas::before {
      display: block;
      margin-bottom: -20px;
      font-size: 16px;
      content: var(--message) var(--changes) !important;
    }
    /** Theme info. */
    .app .iFKgT ._3mkas::after {
      display: block;
      margin-top: 10px;
      padding-top: 10px;
      font-size: 16px;
      content: var(--version) !important;
      border-top: 1px solid var(--darker);
    }

  /* Left drawer. */
  #app .app #side {
    background-color: var(--darker); }

    /* Chat list. */
    #side > header {
      background-color: var(--darker) !important; }

    /* Enable notifications. */
    #side ._2GB6m {
      background-color: var(--accent) !important; }
    /* Low battery. */
    #side ._2t3oV {
      background-color: var(--mred) !important; }
    /* Phone not connected. */
    #side ._1puWZ {
      background-color: var(--mred) !important; }
      /* Text color. */
      #side ._2GB6m *,
      #side ._1puWZ * {
        color: var(--lighter); }

    /* Global -> Search. */
    ._2HS9r {
      border-bottom: 0px solid var(--dark);
      background-color: var(--darker) !important;
